import React, { Component } from 'react';

import styles from './Header.module.css';
import { Link } from 'react-router-dom';
import Logo from '../Logo/Logo';
import Image from '../Decoration/Borders/Images/Image/Image';
import Container from '../../hoc/Container/Container';
import Pnglogo from '../../assets/img/portal-tech.png';
import LogoSk from '../../assets/img/skolkovo2.png'

class Header extends Component {
    render () {
        return (
            <header className={styles.Header}>
                <Container>
                    <Logo img={Pnglogo} />
                    <nav className={styles.Navlist}>
                        <ul>
                            <li><a>О нас</a></li>
                            <li><a>Партнеры</a></li>
                            <li><a>Заявки</a></li>
                            <li><a>Контакты</a></li>
                        </ul>
                        <a><Image src={LogoSk} position='absolute' width='8%' left='63%' top='+1020px' zIndex='200'/></a>
                    </nav>
                </Container>
            </header>
        )
    }
}

export default Header;
